    public class Not
    {
        public int Offset   { get; set; }
        public int Size     { get; set; }
        public int Data     { get; set; }

        public Not(int Offset, int Size, int Data)
        {
            this.Offset = Offset;
            this.Size = Size;
            this.Data = Data;
        }
    }

    public class LowLevelInstructionTable
