        public int _mask                            { get; set; }
        public int _ins                             { get; set; }
        public LowLevelNames Name                   { get; set; }
        public LowLevelInstructionCreate CreateL    { get; set; }
        public Not[] Nots                           { get; set; }

        public LowLevelInstructionTable(string encoding, LowLevelNames Name, LowLevelInstructionCreate CreateL, Not[] Nots)
        {
            this.Name = Name;
            this.CreateL = CreateL;

            this.Nots = Nots;

            for (int i = 0; i < 32; ++i)
            {
                int rp = 31 - i;

                if (encoding[i] == '1' || encoding[i] == '0')
                {
                    _mask |= 1 << rp;
                }

                if (encoding[i] == '1')
                    _ins |= 1 << rp;
            }
        }

