        static LowLevelInstructionTable Create(string Encoding, LowLevelNames Name, LowLevelInstructionCreate Create, params Not[] NotAllowed)
        {
            return new LowLevelInstructionTable(Encoding, Name, Create, NotAllowed);
        }

        public static LowLevelAOpCode GetOpCode(int RawOpCode)
        {
            for (int i = 0; i < Tables.Count; ++i)
            {
                LowLevelInstructionTable table = Tables[i];

                if ((RawOpCode & table._mask) == table._ins)
                {
                    if (table.Nots.Length != 0)
                    {
                        bool Invalid = false;

                        foreach (Not not in table.Nots)
                        {
                            int mask = (1 << not.Size) - 1;

                            if (((RawOpCode >> not.Offset) & mask) == not.Data)
                            {
                                Invalid = true;

                                break;
                            }
                        }

                        if (Invalid)
                        {
                            continue;
                        }
                    }

                    LowLevelAOpCode Out = table.CreateL(RawOpCode, table.Name);

                    Out.RawInstruction = RawOpCode;

                    return Out;
                }
            }

            LowLevelAOpCode _out = new LowLevelAOpCode();

            _out.ClassName = LowLevelClassNames.Unallocated;
            _out.RawInstruction = RawOpCode;

            return _out;
        }

        static Random R = new Random(0);

        public static UInt32 ReverseBytes(UInt32 value)
        {
            return (value & 0x000000FFU) << 24 | (value & 0x0000FF00U) << 8 |
                   (value & 0x00FF0000U) >> 8 | (value & 0xFF000000U) >> 24;
        }
        public static string GetOpHex(int Instruction) => $"{ReverseBytes((uint)Instruction):x8}";

        public static void EmitWith(Aarch64DebugAssembler assembler, LowLevelClassNames Class, LowLevelNames LLN = (LowLevelNames)(-1))
        {
            LowLevelNames ToTest = LLN;

            for (int i = 0; i < Tables.Count; ++i)
            {
                LowLevelInstructionTable table = Tables[i];

                string name = table.CreateL.Method.Name.Replace("Create_", "");

                {
                    LowLevelClassNames _class = (LowLevelClassNames)Enum.Parse(typeof(LowLevelClassNames), name);

                    if ((int)LLN == -1)
                    {
                        ToTest = table.Name;
                    }

                    if (Class == _class)
                    {
                        if (table.Name == ToTest)
                        {
                            uint ins = (uint)table._ins | ((uint)R.Next() & ~(uint)table._mask);

                            if (table.Name == ToTest)
                            {
                                LowLevelAOpCode testForU = GetOpCode((int)ins);

                                if (testForU.ClassName != LowLevelClassNames.Unallocated)
                                {
                                    assembler.Instructions.Add((int)ins);
                                }
                            }
                        }
                    }
                }
            }
        }
    }
